import React from 'react';
import { Box, Heading } from '@chakra-ui/core';
import { gql } from 'apollo-boost';

const CHARACTERS = gql`
  {
    characters(filter: { species: "Alien" }) {
      results {
        id
        name
        status
        species
      }
    }
  }
`;

const CharacterList = () => {
  return (
    <Box p={50}>
      <Heading>Hello</Heading>
    </Box>
  );
};

export default CharacterList;
